import { StyleSheet } from "react-native";

const styles = StyleSheet.create({
    container: {
        flex: 1
    },
    header: {
        marginTop: 40,
        paddingHorizontal: 16,
        flexDirection: 'row',
        justifyContent: 'space-between',
        alignItems: 'center'
    },
    textHeader: {
        fontFamily: 'Inconsolata-Bold',
        fontSize: 30
    },
    ctnProfile: {
        flexDirection: 'row',
        alignItems: 'center',
        marginVertical: 16,
        paddingHorizontal: 16,
        width: '100%',
    },
    ctnImage: {
        width: 88,
        height: 88,
        backgroundColor: '#ffc621',
        borderRadius: 50,
        flexDirection: 'row',
        justifyContent: 'center',
        alignItems: 'center',
        marginRight: 16
    },
    ctnInfo: {
        flexDirection: 'column',
        justifyContent: 'space-between',
        height: 80
    }
});

export default styles;
